  tabChanged(tabChangeEvent: MatTabChangeEvent): void {
    
    this.tabChangeValue = tabChangeEvent.tab.textLabel;
   
    if(tabChangeEvent.tab.textLabel == "Tabular Data"){
      if(this.chartData ==null){
      this.getChartsData("101", "", "");
      }else{        
        this.getTabularChartData(this.chartData);
      }
    }
    if(tabChangeEvent.tab.textLabel == 'Line Chart' || tabChangeEvent.tab.textLabel == undefined){
      if(this.chartData ==null){
      this.getChartsData("101", "", "");
      }else{        
        this._highchart.highchart(this.dataObjChart, 'id3', this.chartData, this.uniHeader, this.locationDetails(), this.mapValueSelected)
      }
    }
    if(tabChangeEvent.tab.textLabel == "Map"){
      if(this.chartData ==null){
      this.getChartsData("101", "", "");
      }else{
        myExtObject.setMapColor(this.chartData,this.mapValueSelected,this.yearSelected);
        
      }

    }
  }

