  getStateNameByCode(udiseStateCode) {

    if (udiseStateCode === "national") {
      return "National";
    } else if (+udiseStateCode > 0) {
      for (let i = 0; i < this.state.length; i++) {
        if (this.state[i].udise_state_code === udiseStateCode) {
          return "State Name :" + this.state[i].state_name;
        }
      }
    } else {
      return "State Name :" + udiseStateCode;
    }
    return "";
  }

  getDistrictByCode(districtCode) {
    if (+districtCode > 0) {
      for (let i = 0; i < this.district.length; i++) {
        if (this.district[i].udise_district_code === districtCode) {
          return this.district[i].district_name;
        }
      }
    }
    return districtCode;
  }

  getBlockByCode(blockCode) {
    if (+blockCode > 0) {
      for (let i = 0; i < this.block.length; i++) {
        if (this.block[i].udise_block_code === blockCode) {
          return this.block[i].block_name;
        }
      }
    }
    return blockCode;
  }

