  showCharts(dataObject, report_name) {
    let tot_clsrm_minor = 0;
    let tot_clsrm_major = 0;
    let goodcondition = 0;
    if (dataObject == "All") {
      this.selectedDeviceObj.forEach(obj => {
        tot_clsrm_minor += obj.tot_clsrm_minor;
        tot_clsrm_major += obj.tot_clsrm_major;
        goodcondition += obj.goodcondition;
      })
    } else {
      tot_clsrm_minor += this.selectedDeviceObj[dataObject.target.value].tot_clsrm_minor;
      tot_clsrm_major += this.selectedDeviceObj[dataObject.target.value].tot_clsrm_major;
      goodcondition += this.selectedDeviceObj[dataObject.target.value].goodcondition;
    }

    let chart = new Chart({
      chart: {
        type: 'pie'
      },
      title: {
        text: this.ChartName
      },
      credits: {
        enabled: false
      }, plotOptions: {
        pie: {
          allowPointSelect: true,
          cursor: 'pointer',
          dataLabels: {
            enabled: true,
            format: '<b>{point.name}</b>: {point.percentage:.1f} %'
          }
        }
      },
      series: [{
        name: 'Brands',
        // colorByPoint: true,
        type: undefined,
        data: [{
          name: 'Minor Repair',
          y: tot_clsrm_minor,
          sliced: true,
          selected: true
        }, {
          name: 'Major Repair',
          y: tot_clsrm_major
        }, {
          name: 'Good Condition',
          y: goodcondition
        }]
      }]
    });
    this.chart = chart;
  }
