  downloadChart() {
    if (Highcharts.charts.length - this.destroyChart == 1) {
      this._highchart.downloadHighChart();
      // (Highcharts as any).exportCharts([Highcharts.charts[0], Highcharts.charts[1]], {
      //   type: "application/pdf"
      // });
    } else {
      const toDataURL = url => fetch(url)
        .then(response => response.blob())
        .then(blob => new Promise((resolve, reject) => {
          const reader = new FileReader()
          reader.onloadend = () => resolve(reader.result)
          reader.onerror = reject
          reader.readAsDataURL(blob)
        }));
      var charts = Highcharts.charts,
        exportUrl = 'https://export.highcharts.com/',
        doc = new jsPDF(),
        pageHeight = doc.internal.pageSize.getHeight(),
        ajaxCalls = [],
        promises = [],
        yDocPos = 0,
        k = 0,
        chart,
        imgUrl,
        i,
        j;

      for (i = 0; i < charts.length; i++) {
        chart = charts[i];
        if (chart != null && chart != 'undefined' && chart != undefined) {
          ajaxCalls.push($.ajax({
            type: 'post',
            url: exportUrl,
            data: {
              options: JSON.stringify(chart.userOptions),
              type: 'image/png',
              async: true
            }
          }));
        }
      }

      $.when.apply(null, ajaxCalls).done(function () {

        for (j = 0; j < arguments.length; j++) {
          // if(Highcharts.charts[j] !=null  && Highcharts.charts[j] !=undefined ){
          imgUrl = exportUrl + arguments[j][0];
          promises[j] = toDataURL(imgUrl);
          // }
        }

        Promise.all(promises).then((values) => {
          values.forEach((value, index) => {
            // if(Highcharts.charts[index] !=null  && Highcharts.charts[index] !=undefined ){
            var page = doc.internal.getCurrentPageInfo();
            if (yDocPos > pageHeight - 150) {
              doc.addPage();
              yDocPos = 25;
              k = 0;
            } else {
              yDocPos = 25 + k * 140;
            }

            doc.setFontSize(30);
            // doc.text(50, yDocPos, 'jspdf title for Chart' + (index + 1));

            yDocPos += 15;
            doc.addImage(value, 'PNG', 20, yDocPos);

            k++;
            // }
          });
          doc.save('charts.pdf');
        });
      });
      // (Highcharts as any).exportCharts([Highcharts.charts[0], Highcharts.charts[1]], {
      //   type: "application/pdf"
      // });
      // // this._highchart.downloadHighChart();
      // const doc = new jsPDF();
      // // const  content = this.uniHichart1.nativeElement;

      // const specialElementHandlers = {
      //   '#hiChartId': function (element, renderer) {
      //     return true;
      //   }
      // };


      // doc.fromHTML(document.getElementById('hiChartId'), 15, 15, {
      //   width: 190,
      //   'elementHandlers': specialElementHandlers
      // });
    }
    // doc.save('test.pdf');
  }

  locationDetails() {
    if (this.uniState === "National") {
      this.reportDescription = "Report type: National";
    } else if (this.uniState === "State Name :all") {
      this.reportDescription = "Report type: State-wise";
    } else if (this.uniDist === "all") {
      this.reportDescription = this.uniState + "   District: All District";
    } else if (this.uniState != "national" && this.uniState != "State Name :all" && this.uniDist == "none") {
      this.reportDescription = this.uniState;
    } else if (this.uniBlock === "all") {
      this.reportDescription = this.uniState + "   District : " + this.uniDist + "    Block : All Block";
    } else if (this.uniState != "national" && this.uniState != "State Name :all" && this.uniDist != "none" && this.uniDist != "all" && this.uniBlock === "none") {
      this.reportDescription = this.uniState + "   District : " + this.uniDist;
    } else {
      this.reportDescription = this.uniState + "   District : " + this.uniDist + "    Block : " + this.uniBlock;
    }
    return this.reportDescription;
  }
